// import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Routes, Route, Outlet } from "react-router-dom";
import Welcome from "./components/Welcome";
import Header from "./components/Navbar";
import Home from "./components/Home";
import Studies from "./components/Studies";
import Contact from "./components/Contact";
import Resume from "./components/Resume";
import Footer from "./components/Footer";


// One function to fade fader in, then update path, then fade fader out

function fadeTo(updateState, state) {
  var fader = $('#fader');
  fader.removeClass('fade-out');
  fader.addClass('fade-in');
  setTimeout(() => {
    updateState(state);
    fader.removeClass('fade-in');
  }, 1000);
}

function App() {
  // const [items, setItems] = useState([{}]);

  // useEffect(() => {
  //   fetch("/api")
  //     .then((response) => response.json())
  //     .then((items) => {
  //       setItems(items);
  //     });
  // }, []);

  return (
    <Router>
      <svg className="fade-out" id="fader"></svg>
      <Routes>
        <Route index element={<Welcome />} />
        <Route path="*" element={<Outlet />} />
      </Routes>
      <Header />
      <Routes>
        <Route index element={<Home />} />
        <Route exact path="/studies" element={<Studies />} />
        <Route exact path="/contact" element={<Contact />} />
        <Route exact path="/resume" element={<Resume />} />
      </Routes>
      <Footer />
    </Router>
  );
}

export default App;
